import { Header } from "./components/Header";
import { Resumo } from "./components/Resumo";
import { Cart } from "./pages/Carrinho";
import { Landing } from "./pages/Landing";

import GlobalStyle from "./styles/global";

function App() {
  return (
    <>
      <GlobalStyle />
      <Header />
      <div className="positionBox">
        <Resumo />
      </div>

      <Landing />
      {/* <Cart /> */}
    </>
  );
}

export default App;
